import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the "Join Event" button to be visible and click it
    await page.waitForSelector('button.btn.btn-secondary.btn-large');
    await page.click('button.btn.btn-secondary.btn-large');

    // Wait for the modal to appear and enter event code
    await page.waitForSelector('#eventCode');
    await page.type('#eventCode', 'example_event_code');

    // Click the "Join Event" button in the modal
    await page.waitForSelector('button.btn.btn-primary');
    await page.click('button.btn.btn-primary');

    // Wait for the events list to load
    await page.waitForSelector('.event-list');

    // Extract metadata from visible events
    const events = await page.$$eval('.event-list .event-item', items => {
      return items.map(item => {
        const date = item.querySelector('.event-date').innerText;
        const participants = item.querySelector('.event-participants').innerText;
        const internalId = item.getAttribute('data-internal-id');
        return { date, participants, internalId };
      });
    });

    // Take a screenshot of the events list
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_events_list.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_events_list.png'));

    return {
      success: true,
      action: "Extracted event metadata successfully",
      extractedData: { events },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

