import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the Join Event button to be visible and click it
    await page.waitForSelector('button.btn.btn-secondary.btn-large', { timeout: 5000 });
    await page.click('button.btn.btn-secondary.btn-large');

    // Wait for the modal to appear
    await page.waitForSelector('.modal', { timeout: 5000 });

    // Input the event code
    await page.waitForSelector('#eventCode', { timeout: 5000 });
    await page.fill('#eventCode', 'YOUR_EVENT_CODE_HERE');

    // Submit to join the event
    await page.click('button.btn.btn-primary');

    // Wait for the event details to load
    await page.waitForSelector('.event-details', { timeout: 5000 });

    // Extract metadata from the event details
    const eventData = await page.evaluate(() => {
      const date = document.querySelector('.event-date')?.innerText || '';
      const participants = Array.from(document.querySelectorAll('.participant-list .participant')).map(el => el.innerText);
      const internalId = document.querySelector('.event-id')?.innerText || '';
      return { date, participants, internalId };
    });

    // Take a screenshot of the event details
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_event_details.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_event_details.png'));

    return {
      success: true,
      action: "Extracted event metadata including dates, participants, and internal IDs",
      extractedData: eventData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
